import Layout from "../components/layout/layout";
import MenuIcon from "../icons/menu";
import CartIcon from "../icons/cart";
import UserIcon from "../icons/user";
import StoreIcon from "../icons/store";
import SettingsIcon from "../icons/settings";
import HashtagIcon from "../icons/hashtag";
import DarrowIcon from "../icons/darrow";

function Dashboard() {
  const position = {
    container: "flex gap-3 w-full h-full",
    lwrapper: "w-1/4 h-full p-4",
    rwrapper: "w-3/4 h-full",
    menu: "*:flex *:gap-2",
  };
  const design = {
    lwrapper: "bg-gray-50 rounded-xl",
    rwrapper: "bg-gray-50 rounded-xl",
  };

  return (
    <Layout>
      <div className={`${position.container}`}>
        <div className={`${position.lwrapper} ${design.lwrapper}`}>
          <div className={position.menu}>
            <div>
              <MenuIcon />
              <p>Dashboard</p>
            </div>
            <div>
              <CartIcon />
              <p>Orders</p>
              <DarrowIcon />
            </div>
            <div>
              <HashtagIcon />
              <p>Products</p>
              <DarrowIcon />
            </div>
            <div>
              <UserIcon />
              <p>Customers</p>
            </div>
            <div>
              <StoreIcon />
              <p>Store</p>
              <DarrowIcon />
            </div>
            <div>
              <SettingsIcon />
              <p>Settings</p>
            </div>
          </div>
        </div>
        <div className={`${position.rwrapper} ${design.rwrapper}`}></div>
      </div>
    </Layout>
  );
}

export default Dashboard;
